import java.util.*;
import java.math.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int H = sc.nextInt();
        int W = sc.nextInt();
        char[][] S = new char[H][W];
        for (int i = 0; i < H; i++) {
            String s = sc.next();
            for (int j = 0; j < W; j++) {
                S[i][j] = s.charAt(j);
            }
        }

        Set<String> set = new HashSet<>();
        for (int i = 0; i < (1 << H); i++) {
            char[][] T = new char[H][W];
            for (int j = 0; j < H; j++) {
                for (int k = 0; k < W; k++) {
                    T[j][k] = S[j][k];
                }
            }
            for (int j = 0; j < H; j++) {
                if ((i >> j) % 2 == 1) {
                    for (int k = 0; k < W / 2; k++) {
                        char tmp = T[j][k];
                        T[j][k] = T[j][W - 1 - k];
                        T[j][W - 1 - k] = tmp;
                    }
                }
            }
            for (int j = 0; j < (1 << W); j++) {
                char[][] U = new char[H][W];
                for (int k = 0; k < H; k++) {
                    for (int l = 0; l < W; l++) {
                        U[k][l] = T[k][l];
                    }
                }
                for (int k = 0; k < W; k++) {
                    if ((j >> k) % 2 == 1) {
                        for (int l = 0; l < H / 2; l++) {
                            char tmp = U[l][k];
                            U[l][k] = U[H - 1 - l][k];
                            U[H - 1 - l][k] = tmp;
                        }
                    }
                }
                StringBuilder sb = new StringBuilder();
                for (int k = 0; k < H; k++) {
                    for (int l = 0; l < W; l++) {
                        sb.append(U[k][l]);
                    }
                }
                set.add(sb.toString());
            }
        }
        System.out.println(set.size());
    }
}
